import apiClient from "./apiClient";

export const folderPost = async (headers) => {
    try {
      const response = await apiClient.post("/folder", {}, { headers });
      return response.data;
    } catch (error) {
      console.error("folderPost failed:", error);
      throw error;
    }
  };
